import NavbarMain from './components/NavbarMain';
import LoginUserField from './components/LoginUserField';


function App() {
  return (
    <div className="App">
      <header className="App-header">
        <NavbarMain />
      </header>
      <body>
        <LoginUserField />
      </body>
    </div>
  );
}

export default App;
